"use client";
import React, { useState } from "react";

const products = [
  { id: 1, name: "Hydroponic Spinach (Palak)", price: 45.00, unit: "250 GM", image: "data:image/jpeg;base64," },
  { id: 2, name: "Hydroponic Cherry Tomato", price: 90.00, unit: "250 GM", image: "data:image/jpeg;base64," },
  { id: 3, name: "Hydroponic Cucumber (Kheera)", price: 55.00, unit: "500 GM", image: "data:image/jpeg;base64," },
  { id: 4, name: "Hydroponic Coriander (Dhaniya)", price: 35.00, unit: "100 GM", image: "data:image/jpeg;base64," },
  { id: 5, name: "Hydroponic Green Chillies (Hari Mirch)", price: 25.00, unit: "100 GM", image: "data:image/jpeg;base64," },
  { id: 6, name: "Hydroponic Capsicum (Shimla Mirch)", price: 75.00, unit: "500 GM", image: "data:image/jpeg;base64," },
  { id: 7, name: "Hydroponic Mint (Pudina)", price: 20.00, unit: "1 BUNCH", image: "data:image/jpeg;base64," },
  { id: 8, name: "Hydroponic Lettuce (Lollo Rosso)", price: 65.00, unit: "1 PC", image: "data:image/jpeg;base64," },
];

export default function HydroponicVegetables() {
  // Har product ki quantity independently manage karne ke liye state
  const [quantities, setQuantities] = useState(
    products.reduce((acc, product) => ({ ...acc, [product.id]: 1 }), {})
  );

  const updateQty = (id, delta) => {
    setQuantities(prev => ({
      ...prev,
      [id]: Math.max(1, prev[id] + delta)
    }));
  };

  return (
    <div className="hydroponic-page">
      {/*  Centered Heading Section */}
      <div className="page-header">
        <h1 className="main-heading">Hydroponic Veggies</h1>
        <p className="sub-heading">Fresh, juicy, and farm-direct Indian hydroponic varieties.</p>
      </div>

      {/*  Product Grid Section */}
      <div className="product-grid">
        {products.map((p) => {
          const currentQty = quantities[p.id];
          const totalAmount = (p.price * currentQty).toFixed(2); // Live price calculation

          return (
            <div className="product-card" key={p.id}>
              <div className="img-container">
                <img src={p.image} alt={p.name} />
              </div>
              
              <h4 className="p-title">{p.name}</h4>
              <div className="p-price">Rs. {totalAmount}</div>
              <div className="p-unit">{p.unit}</div>

              {/* Quantity Picker Logic */}
              <div className="qty-selector">
                <button onClick={() => updateQty(p.id, -1)} aria-label="Decrease quantity">-</button>
                <input type="text" value={currentQty} readOnly />
                <button onClick={() => updateQty(p.id, 1)} aria-label="Increase quantity">+</button>
              </div>
              
              {/* Green Add to Cart Button */}
              <button className="cart-action-btn">Add to Cart</button>
            </div>
          );
        })}
      </div>

      <style jsx global>{`
        body { margin: 0; font-family: 'Inter', sans-serif; background: #fff; }

        .hydroponic-page { 
          max-width: 1400px; 
          margin: 0 auto; 
          padding: 60px 5%; 
        }

        .page-header { 
          text-align: center; 
          margin-bottom: 50px; 
        }

        .main-heading { 
          font-size: 36px; 
          font-weight: 800; 
          color: #333; 
          margin-bottom: 10px; 
        }

        .sub-heading {
          font-size: 14px;
          color: #777;
        }

        .product-grid { 
          display: grid; 
          grid-template-columns: repeat(auto-fill, minmax(240px, 1fr)); 
          gap: 30px; 
        }

        .product-card { 
          border: 1px solid #f2f2f2; 
          border-radius: 12px; 
          padding: 20px; 
          text-align: center; 
          display: flex; 
          flex-direction: column; 
          transition: all 0.3s ease;
          background: #fff;
        }

        .product-card:hover { 
          transform: translateY(-5px); 
          box-shadow: 0 12px 30px rgba(0,0,0,0.07); 
        }

        .img-container { 
          height: 180px; 
          display: flex; 
          align-items: center; 
          justify-content: center; 
          margin-bottom: 15px; 
        }

        .img-container img { max-height: 100%; max-width: 100%; object-fit: contain; }

        .p-title { font-size: 15px; font-weight: 600; color: #444; height: 40px; margin: 5px 0; }
        .p-price { font-size: 18px; font-weight: 700; color: #111; margin-bottom: 6px; }

        .p-unit { 
          font-size: 11px; 
          background: #f8f8f8;
          color: #888;
          padding: 4px 12px;
          border-radius: 4px;
          display: inline-block;
          align-self: center;
          margin-bottom: 20px;
          font-weight: bold;
        }

        .qty-selector { 
          display: flex; 
          border: 1px solid #e0e0e0; 
          border-radius: 6px; 
          overflow: hidden; 
          align-self: center; 
          margin-bottom: 15px; 
        }

        .qty-selector button { background: #fff; border: none; padding: 8px 15px; cursor: pointer; font-size: 18px; }
        .qty-selector input { width: 40px; text-align: center; border-left: 1px solid #e0e0e0; border-right: 1px solid #e0e0e0; border-top: none; border-bottom: none; font-weight: 600; }

        .cart-action-btn { 
          background: #6aa333; 
          color: #fff; 
          border: none; 
          padding: 12px; 
          border-radius: 8px; 
          font-weight: 700; 
          font-size: 14px; 
          cursor: pointer; 
          margin-top: auto; 
          transition: background 0.2s;
        }

        .cart-action-btn:hover { background: #5a8d2a; }
      `}</style>
    </div>
  );
}